const Roomlist = ({ rooms }) => {
  return (
    <div className="rooms-list">
      {rooms.map(rooms => (
        <div className="rooms-preview" key={rooms.name} >
          <h2>{ rooms.title }</h2>
          <p>Written by { rooms.author }</p>
        </div>
      ))}
    </div>
  );
}
 
export default Roomlist;
